import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Display extends React.Component {

  render() {
    const status = 'Magic Minutes';

    return (
      <div>
        <div className="status">{status}</div>
        // <div className="board-row">
        //   {this.renderSquare(0)}
        //   {this.renderSquare(1)}
        //   {this.renderSquare(2)}
        // </div>
        <div className="board-row">
          {this.renderSquare(3)}
          {this.renderSquare(4)}
          {this.renderSquare(5)}
      //   </div>
      //   <div className="board-row">
      //     {this.renderSquare(6)}
      //     {this.renderSquare(7)}
      //     {this.renderSquare(8)}
      //   </div>
      // </div>
    );
  }
}
